    data: |
      SELECT ALL col2 + + col0 + + 99 / - col0 + 38 + + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE ( - - col2 + + col2 / col0 * col1 ) IS NULL;
  - name: tab1

outputs:
  - name: q9355.out
    data: |
